    private static string GetFullPathFolder(IConfiguration configuration, string fileName)
    {
        return Path.Combine(
                            Path.GetFullPath(configuration[Constants.FileConstans.STORED_FILES_PATH]),
                            Enum.GetName(Enums.FolderChild.ChuongTrinhHoc), Enum.GetName(Enums.FolderChild.CauLacBo), fileName);
    }

